import React from "react"
import Data from "./Data"
import './index.css'

function Prodact(){
    const [pri,setpri]=React.useState("")
   
    function Show(price){
        return(
            setpri(price))
    }
    const arr=Data.map((el)=>{
        return(
          <div className="CardList" key={el.id}>
            <img src={el.image} alt="" />
            <h1>{el.title}</h1>
            <p>{el.description}</p>
           
            <button onClick={()=>Show(el.price)}>To Find Out the Price</button>
           {<></>}
            </div>
        )
    })
    return(
<div className="List">
    {arr}
</div>
    )
}
export default Prodact
